package com.ns.common.bean;public class Head {    private String errMsg;    private Integer errCode;    public String getErrMsg() {        return errMsg;    }    public void setErrMsg(String errMsg) {        this.errMsg = errMsg;    }    public Integer getErrCode() {        return errCode;    }    public void setErrCode(Integer errCode) {        this.errCode = errCode;    }    @Override    public String toString() {        return "Head [errMsg=" + errMsg + ", errCode=" + errCode + "]";    }}